import React, { useState } from 'react'

const Content = () => {
    const[items , setItems] = useState(
    [{
        id:1,
        checked:true,
        item : "Learn Reactjs"
    },
    {
        id:2,
        checked:true,
        item : "Practise Reactjs"
    },
    {
        id:3,
        checked:true,
        item : "Learn AI"
    }

    ])




    return(
        <main>
            <ul>
                {items.map((item)=>(
                 <li>
                      <input
                        type="text"
                        checked={item.checked}
                      />  
                    <label>{item.item}</label>
                    <button>Delete</button>



                </li>


            ))}
            </ul>


        </main>
    )
}

export default Content;
